import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter} from 'react-router-dom'
import Masterroute from './component/Mainroute';
ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Masterroute/>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
